import React from 'react';

const VideoSection = () => {
  return (
    <section className="youtube-section">
      <h2>Watch How It Works</h2>
      <iframe
        src="https://www.youtube.com/embed/dQw4w9WgXcQ"
        title="Surgery Video"
        allowFullScreen
      ></iframe>
    </section>
  );
};

export default VideoSection;
